function isValid(s) {
  //   console.log(s);
  let freq = {};
  [...s.split("")].forEach((char) => {
    if (!freq[char]) {
      freq[char] = 1;
    } else {
      freq[char] += 1;
    }
  });

  //   console.log(freq);

  let counts = {};

  Object.values(freq).forEach((count) => {
    if (!counts[count]) {
      counts[count] = 1;
    } else {
      counts[count] += 1;
    }
  });

  let test = Object.keys(counts);
  let tmp = [];
  test.forEach((e) => {
    tmp.push({
      key: e,
      value: counts[e],
    });
  });

  //   console.log(tmp);

  //   let test = Object.values(counts);

  if (test.length <= 1) {
    return "YES";
  } else if (test.length == 2) {
    if (tmp[0].value == 1) {
      if (tmp[0].key - 1 == 0 || tmp[0].key - 1 == tmp[1].key) return "YES";
    } else if (tmp[1].value == 1) {
      if (tmp[1].key - 1 == 0 || tmp[1].key - 1 == tmp[0].key) return "YES";
    }
  }

  return "NO";
}

console.log(
  isValid(
    ""
  )
);

console.log(
  isValid("aaabbcc"),
  isValid("aaaaabc"),
  isValid("aabbccddeefghi"),
  isValid("abcdefghhgfedecba"),
  isValid("abbbbccccdddd"),
  isValid("aaaabbcc"),
  isValid("aaabbcc")
);
